(window.webpackJsonp=window.webpackJsonp||[]).push([[24],{318:function(e){e.exports={data:{tag:{title:"volta",belongsTo:{edges:[{node:{title:"Antes tarde Duke Nukem",path:"/blog/antes-tarde-duke-nukem",date:"10. May 2013",timeToRead:1,description:"Antes tarde Duke Nukem",coverImage:{type:"image",mimeType:"image/jpeg",src:"/assets/static/duke-nukem.07cc2b7.cff32e2.jpg",size:{width:860,height:252},sizes:"(max-width: 860px) 100vw, 860px",srcset:["/assets/static/duke-nukem.a67b0b2.cff32e2.jpg 480w","/assets/static/duke-nukem.07cc2b7.cff32e2.jpg 860w"],dataUri:"data:image/svg+xml,%3csvg fill='none' viewBox='0 0 860 252' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'%3e%3cdefs%3e%3cfilter id='__svg-blur-12'%3e%3cfeGaussianBlur in='SourceGraphic' stdDeviation='10'/%3e%3c/filter%3e%3c/defs%3e%3cimage x='0' y='0' filter='url(%23__svg-blur-12)' width='860' height='252' xlink:href='data:image/jpeg%3bbase64%%%2bd8ejnItnl%2bzKnzSUUVTJR//Z' /%3e%3c/svg%3e"},content:'<p>(Sim, eu estou voltando com essa piada velha!)</p>\n<p>Passei um tempo pensando em voltar com meu blog, mas perdi o source do antigo, então, bateu aquela preguiça de começar tudo de novo... Porém, hoje eu li um post do <a href="http://www.akitaonrails.com/2013/05/10/if-campanha-iniciante-friday--2#.UY2bGKA2438" target="_blank" rel="nofollow noopener noreferrer">Fábio Akita</a> e o mesmo está iniciando um movimento muito legal, convocando a todos os devs para iniciarem uma série de posts voltados para os iniciantes e convidando também os iniciantes para começarem seus próprios blogs.</p>\n<p>Acredito que me enquadro em ambas as categorias, e me deu vontade de voltar a escrever. Não vou prometer nada, mas vou tentar ser mais presente na comunidade web.</p>\n<p>Bom, é isso. Vamos ver o que vem pela frente!</p>\n<p>Até mais.</p>\n'}}]}}}}}}]);